INSERT INTO `ctb_activity` (`id`, `title`, `catid`, `img`, `img1`, `description`, `vedio_url`, `content`, `inputtime`) VALUES
(1, '维京联盟——16年12月发布会', 1, '../upload/./201803/1/0_152017488GQgt.jpg', '../upload/./201803/1/0_152017500G74N.jpg', '“维京人”，指北欧海盗，他们从公元8世纪到11世纪一直侵扰欧洲沿海和英国岛屿，其足迹遍布从欧洲大陆至北极广阔疆域。', '', '<p style="margin-bottom: 5px;">2016年12月，重庆高校创业团队维京联盟在重庆举行了易点学车新品发布会。全重庆20余所高校100余人高校团队及易点学车创始人团队均出席了这一盛况，维京联盟以几位大学生为联合创始人并与重庆知名实体驾校共同推出互联网+实体驾校模式，其成员也来自不同的重庆高校大学生，这是一支由大学生组成的具备特色团队文化的创业团队，立志打造成重庆大学生中最具竞争力的创业团队和产业版块。本次发布会由易点学车创始人及CEO进行主题分享，主要围绕：驾培行业分析、互联网平台模式讲解、易点学车核心价值和优势及维京联盟团队未来发展规划进行了细致的分享，全体团队成员深入其中，兴趣盎然。</p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504002725231916.jpg" title="1504002725231916.jpg" alt="1504002725231916.jpg" width="350" height="263"/></p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003189241018.jpg" title="1504003189241018.jpg" alt="1504003189241018.jpg" width="350" height="262"/></p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003216492394.jpg" title="1504003216492394.jpg" alt="1504003216492394.jpg" width="350" height="233"/></p><p style="margin-bottom: 5px;">在发布会上，易点学车CEO为大家详细的分析了互联网对于未来驾培行业的影响，以强有力的例子为大家说明了互联网+驾校未来的发展前景。互联网深入驾培行业其实是一个“不被接受，被迫接受，主动接受，深入市场”的过程，目前重庆传统驾校300余家，自2014年起已经出现了严重的供大于求的局面，80%以上驾校处于生源不饱和，为了生存，大部分驾校不得已以降低学费价格、降低服务标准来吸纳生源，导致行业乱象丛生，广大学员特别是大学生学员苦不堪言。行业以服务标准不量化、学员体验度差、消费不透明已经成为传统驾校最为核心的三大主流问题。驾培行业变革已经是国家和驾培从业者们不得不面对的事情。随着互联网时代的不断渗透，互联网跨界打劫驾培行业的速度空前高涨，而目前的互联网驾校模式切入只在表面价格上对行业造成了严重恐慌和危机，而驾校深层次及本质的服务标准却无法量化，因此，易点学车应时代的要求就粉墨登场。</p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003277766496.jpg" title="1504003277766496.jpg" alt="1504003277766496.jpg" width="350" height="233"/></p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003320388309.jpg" title="1504003320388309.jpg" alt="1504003320388309.jpg" width="350" height="233"/></p><p style="margin-bottom: 5px;"><span style="font-size:14px;font-family:宋体">易点学车不同于传统的实体驾校和目前市场上的互联网驾校，易点学车是一家高度融合互联网</span><span style="font-size:14px;font-family:&#39;Calibri&#39;,sans-serif">+</span><span style="font-size:14px;font-family:宋体">实体驾校的创新型互联网品牌，以互联网独有的高效快捷方式全面提升驾驶培训的服务效率和重塑服务品质，改变传统驾校的用户服务体验差，消费不透明，服务流程繁琐的本质问题，将互联网思维模式与实体驾校优质教学服务团队进行高度融合，以让学员达到极致的服务体验。</span></p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003362323984.jpg" title="1504003362323984.jpg" alt="1504003362323984.jpg" width="350" height="263"/></p><p style="margin-bottom: 5px;"><span style="font-size:14px;font-family:宋体">发布会中旬，维京联盟的创始人，投资人等为易点学车发布进行剪彩，预祝易点学车的成功。</span></p><p style="text-align: center; margin-bottom: 5px;"><span style="font-size:14px;font-family:宋体"><img src="/ueditor/php/upload/image/20170829/1504003404346785.jpg" title="1504003404346785.jpg" alt="1504003404346785.jpg" width="350" height="233"/></span></p><p style="margin-bottom: 5px;">在发布会进行的第三阶段，现场的高校代表们向创始人们提出了自己的建议和疑问，易点公司团队均一一回复了各高校代表的疑问。</p><p style="margin-bottom: 5px;">重庆师范大学的同学认为，互联网+驾校虽然很有市场，但是大家对实体驾校的不信任明显已经影响到了互联网+驾校的发展，那么我们应该如何向学员介绍？易点学车的核心竞争力在哪里？创始人代表回答：互联网是时代发展要求，互联网+驾校也是驾培行业的必然趋势，互联网一定会以特有的优势快速的渗透到任何的传统行业，以快速、极致、去中间化、碎片化特征重塑传统行业的本质，当然任何变革都是痛苦的，消费者都是在处于观望、接受的过程，随着滴滴模式及互联网改革的各行各业的普及，大众已经深入体验到互联网带给这个时代和社会的高效快捷，互联网已经不再那么陌生，未来两年一定是互联网快速渗透驾培行业的核心阶段。</p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003446793109.jpg" title="1504003446793109.jpg" alt="1504003446793109.jpg" width="350" height="233"/></p><p style="margin-bottom: 5px;">第四部分，维京联盟的创始人们带领各位高校代表体验了易点学车的使用方法和操作流程，当然，在还没有全面推向市场前，一些产品核心的内容还没有完全上线，请大家敬请期待。</p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003480157997.jpg" title="1504003480157997.jpg" alt="1504003480157997.jpg" width="350" height="233"/></p><p style="margin-bottom: 5px;"><span style="font-size:14px;font-family:宋体">第五部分，维京联盟创始人为各位高校代表颁发聘书</span></p><p style="text-align: center; margin-bottom: 5px;"><br/></p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003529475990.jpg" title="1504003529475990.jpg" alt="1504003529475990.jpg" width="350" height="233"/></p><p style="margin-bottom: 5px;">第六部分，维京联盟的创始人为各位高校代表介绍易点学车的下步规划，并详细介绍了维京联盟的创立初衷和未来发展方向，在热烈的掌声中，维京联盟团队明确了未来两年的奋斗目标，发布会最后的抽奖活动也正式开始。</p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003565756054.jpg" title="1504003565756054.jpg" alt="1504003565756054.jpg" width="350" height="233"/></p><p style="margin-bottom: 5px;"><span style="font-family:宋体">各高校团队代表幸运抽奖</span></p><p style="text-align: center; margin-bottom: 5px;"><img src="/ueditor/php/upload/image/20170829/1504003592596902.jpg" title="1504003592596902.jpg" alt="1504003592596902.jpg" width="350" height="233"/></p><p style="margin-bottom: 5px;">有志者，事竟成，破釜沉舟，百二秦关终属楚，苦心人，天不负，卧薪尝胆，三千越甲可吞吴，天下大势，浩浩荡荡，顺之者昌逆之者亡。易点学车是应时代发展的趋势而诞生，立志以树立行业服务正气和标准，做互联网与驾校模式的探路者和先行者，尽管前方依然会充满崎岖和坎坷，但全体维京联盟军团士气如虹，众志成城，相信定会以排山倒海般的气势进入驾培市场，共同为驾培行业发展与未来尽我们的绵薄之力，共同祝愿：易点学车，扬帆远航，维京联盟，旗开得胜！</p><p style="text-align: center; margin-bottom: 5px;"><br/></p><p><br/></p>', 1519887002),
(3, '优势服务', 3, '../upload/./201708/18/0_1503326036Cg4.jpg', '../upload/./201708/28/0_150418962w3X3.jpg', '', '', '<p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">服务特色</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">易点学车引入智能化驾培体系，全面重塑服务品质，拒绝传统教练冷嘲热讽、日晒雨淋，杜绝吃拿卡要；智能化驾培体系拥有高速撞车、翻车的模拟体验，旨在全面提高广大学车学员安全文明驾驶能力。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">易点学车练车、考试、接送过程中全程保险赔付，保额高达80万元，从报名开始直到拿证全程护航。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">优势承诺</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">1.&nbsp;智能化学车平台：精准教学，拒绝冷嘲热讽，日晒雨淋</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">2.&nbsp;VR练车：提高安全文明驾驶，重塑驾培体验；足不出校，轻松学车</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">3.&nbsp;优秀教练：优秀直营教练，通过率提高20%</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">4.&nbsp;就近学车：众多场地供你选择，距离学校不超过2KM</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">5.&nbsp;费用透明：拒绝价格陷阱，绝无隐形消费</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">6.&nbsp;学车保障：80万高额保险，学车无忧</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">7.&nbsp;急速拿证：标准两月拿证流程，最快40天</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">8.&nbsp;考试保过：五次考爆不过免费重学</p><p><br/></p>', 1504007796),
(4, 'VR学车', 3, '../upload/./201708/18/0_150332785BXit.jpg', '../upload/./201708/27/0_1504107678QwI.jpg', '', '', '', 1503819792),
(5, '学车流程', 3, '../upload/./201708/18/0_150332813hDBM.jpg', '../upload/./201708/29/0_1504293563PT0.jpg', '', '', '<p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: center;"><a href="http://yidianxueche.cn/index.php?do=new_detail&id=11" target="_blank"><span style="font-size: 18px;"><span style="text-decoration: underline;">理论预约流程</span></span></a><span style="font-size: 18px;"><span style="text-decoration: underline;"></span> &nbsp; &nbsp; &nbsp;&nbsp;<a href="http://yidianxueche.cn/index.php?do=new_detail&id=12" target="_blank"><span style="text-decoration: underline;">约考缴费流程</span></a></span></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><span style="font-size: 20px;"><strong><br/></strong></span></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><span style="font-size: 20px;"><strong>报名流程</strong></span></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">1. 预约免费体验或观摩场地</span></strong><br/></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">2. 平台内发布需求或者联系高校市场团队，相应人员会在12小时内与您取得联系，安排时间接送观摩场地或者免费试驾以及体验VR学车。</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">3. 选择教练员</span></strong></p><p style="text-indent: 0em; margin-top: 5px; margin-bottom: 5px; line-height: normal;">可以通过平台选择距离当前位置或指定位置最近的场地和教练员学员朋友可以直接直观的选择教练员了解信息，确保选择到心仪教练员。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">4. 选择班别</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">选择教练员后，选择心仪的班别服务，了解班别服务标准，然后选择适合自身情况的班别。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">5. 填写报名信息</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">点击立即报名，输入相关详细个人信息。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">6. 支付</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">进行微信支付完成报名，支付成功之后的信息需要详细查看并且记住。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">7. 报名完成</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">报名完成后，平台会提示您接下来的操作步骤以准备入籍资料，在准备好资料之后，请您联系提示的联系人以完成资料入籍。同时24小时内公司客服人员会联系您，并给您提示报名后的详细准备工作。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">体检：可在平台内选择离您最近的体检站进行体检（请带上手机以及身份证原件）；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">拍照：按照提示的规范进行相应照片拍摄；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">入籍：学员完成入籍资料发送之后，在7个工作日内会收到“重庆交巡警”以及“西培学堂”的短信，收到“重庆交巡警的短信表示已经可以预约科目一考试了”，但是<strong><span style="color:#ff0000">请记住在科目二练车之前请将科目一所有学时打完，否则会严重影响后续进程！</span></strong>在收到“西培学堂”的短信之后表示您已经可以预约科目一的学习了！详细预约流程请查看个人中心—&gt;理论预约流程。<a href="http://yidianxueche.cn/index.php?do=new_detail&id=11" target="_blank" style="white-space: normal; border: 1px solid rgb(0, 0, 0); color: rgb(0, 0, 0); text-decoration: underline;"><span style="border: 1px solid rgb(0, 0, 0); color: rgb(0, 0, 0);">点击前往</span></a></p><p><br/></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><span style="font-size: 18px;"><strong>开始学车</strong></span></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">科目一</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">在收到“西培学堂”的短信之后表示您已经可以预约科目一理论学习了，详细流程以及学习方法请参考个人中心—&gt;理论预约流程。&nbsp;<span style="border: 1px solid rgb(0, 0, 0); border-image-source: initial; border-image-slice: initial; border-image-width: initial; border-image-outset: initial; border-image-repeat: initial; text-decoration: underline;"><a href="http://yidianxueche.cn/index.php?do=new_detail&id=11" target="_blank" style="border: 1px solid rgb(0, 0, 0); text-decoration: underline;">点击前往</a></span></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">在收到“重庆交巡警”的初始密码短信之后，表示您已经可以开始预约科目一考试，请确保您科目一理论学习全部完成之后，在个人中心—&gt;约考缴费流程 &nbsp;<a href="http://yidianxueche.cn/index.php?do=new_detail&id=12" target="_blank" style="border: 1px solid rgb(0, 0, 0); text-decoration: underline;"><span style="border: 1px solid rgb(0, 0, 0);">点击前往</span></a> &nbsp;内查看约考缴费流程方法以及预约考试。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">科目二</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">科目一合格之后，您就可以开始联系自己的教练开始预约学车。练车请提前一天联系教练预约，报名自己练车的连续性，学习完毕之后根据自己的时间结合教练员的安排进行预约科目二考试。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">科目三</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">完成科目二学习之后可根据科目二练车标准进行科目三练车，然后根据自己时间结合教练员安排预约科目三考试以及科目三安全文明考试（科目四）。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">在通过科目三考试当天约一个小时后开始科目三安全文明考试（科目四）。</p><p><br/></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">恭喜取得中华人民共和国驾驶证！</span></strong></p>', 1515051064),
(6, '学车保障', 3, '../upload/./201708/18/0_1503328307Jxv.jpg', '../upload/./201708/29/0_1504295261u60.jpg', '', '', '', 1504007263),
(7, '易点简介', 1, '../upload/./201708/27/0_150411491jlRB.jpg', '../upload/./201708/28/0_150418568q76d.jpg', '在重庆，有那么一个集体：易点学车&维京联盟...', '', '<p style="margin-top: 5px;"><span style="font-size: 24px;"><strong><span style="font-family: 宋体;">易点学车概述</span></strong></span></p><p style="margin-top: 5px;"><span style="font-size: 20px; font-family: 宋体;"><br/></span></p><p style="margin-top: 5px;">易点学车是一家高度融合互联网+实体驾校的创新型互联网品牌，以互联网独有的高效快捷全面提升驾驶培训的服务效率和重塑服务品质。以全直营的结构模式整体提升广大学车群体对于互联网驾校、互联网学车平台的认知不足，并解决互联网驾校服务痛点。为更好的提升学员服务体验和教学标准化，易点学车颠覆传统学驾模式引入人工智能教学设备，打造全国首家智能化学车平台。首推VR全虚拟现实练车+机器人教练员执教，该智能系统将人工智能、虚拟现实、大数据、智能传感、物联网和“互联网+”等技术全面融合在一起。用人工智能为每名学员带去极致的学车体验，定制出中国好司机。</p><p style="margin-top: 5px;">&nbsp;</p><p style="margin-top: 5px;">&nbsp;</p><p style="margin-top: 5px;"><strong><span style="font-size: 20px; font-family: 宋体;">产品介绍</span></strong></p><p style="margin-top: 5px;"><strong><span style="font-family: 宋体; font-size: 18px; text-indent: 28px;">易点简介</span></strong></p><p style="margin-top: 5px;">易点学车是一个全直营（自有教练员、场地、车辆）、高度融合互联网+实体驾校的创新性互联网品牌，以互联网独有的高效快捷全面提升驾驶培训的服务效率和重塑服务品质。2017年9月易点学车颠覆传统结合智能化学车平台引进VR学车以及智能机器人教练，用人工智能为每名学员带去极致的学车体验，定制出中国好司机。</p><p style="margin-top: 5px;">易点学车创始人团队都是在驾培行业耕耘已久有足够经验的在校大学生或者应届毕业生，作为大学生的他们深知大学生在校期间学车的重要性及市场广阔程度。打造成全国首家大学生专属智能化学车平台这是易点学车的必经之路。</p><p style="margin-top: 5px;"><strong><span style="font-size: 18px; text-indent: 28px;">VR</span><span style="font-size: 18px; text-indent: 28px; font-family: 宋体;">学车简介</span></strong></p><p style="margin-top: 5px;">虚拟现实技术是一种可以创建和体验虚拟世界的计算机仿真系统，它利用计算机生成一种模拟环境，是一种多源信息融合的、交互式的三维动态视景和实体行为的系统仿真使用户沉浸到该环境中。学员通过VR进入训练场景，真实的感受与实景场地及考场练车场景同等的效果和体验，足不出户就可以成为老司机。</p><p style="margin-top: 5px;"><strong><span style="font-size: 18px;">机器人教练简介</span></strong></p><p style="margin-top: 5px;">人工智能机器人教练作为一款集人工智能、虚拟现实、大数据、智能传感、互联网+以及物联网等技术于一体的高技术产品，通过在真实的教练车平台上集成部署智能教学系统与主动安全防控系统，将驾校现有的普通教练车打造成本领高超的“机器人教练”，可完全替代人工教练对学员进行训练。全新的智能三维场景，学车体验更为生动直观；全语音智能人机交互，发号施令动口不动手；安全体系全面升级，多维立体防控呵护绝对平安；人工智能引擎迭代进化，超级大脑打造超人教练；科学植入素质养成训练，安全意识与驾驶习惯护佑驾者一生；无缝对接机器人教练智能后台服务系统，线上线下完美互动，手机便捷获取行车轨迹与学车分析报告。</p><p style="margin-top: 5px;">&nbsp;</p><p style="margin-top: 5px;"><span style="font-size: 20px;">发展历程</span></p><p style="margin-top: 5px;">2016年12月，易点学车成立。自成立以来，受到了重庆各个区域高校在校大学生的高度认可。</p><p style="margin-top: 5px;">2017年3月，单月招生接近2000人，完成市场规模扩大。</p><p style="margin-top: 5px;">2017年5月，完成重庆主城各个区域的覆盖布局，并将覆盖区域开始向区县扩张。</p><p style="margin-top: 5px;">2017年9月，引进VR学车以及智能机器人教练以颠覆传统的模式进行服务质量的提高。</p><p style="margin-top: 5px;"><br/></p><p style="margin-top: 5px;">&nbsp;</p><p style="margin-top: 5px;"><strong><span style="font-size: 20px;">其他团队组成</span></strong></p><p style="margin-top: 5px;"><strong><span style="font-size: 18px;">维京联盟</span></strong></p><p style="margin-top: 5px;">高校市场部一直是易点学车最为重要的部门，在易点学车成立之初，维京联盟应运而生。</p><p style="margin-top: 5px;"><strong><span style="font-size: 18px;">维京联盟团队文化</span></strong></p><p style="margin-top: 5px;">“维京人”，指北欧海盗，他们从公元8世纪到11世纪一直侵扰欧洲沿海和英国岛屿，其足迹遍布从欧洲大陆至北极广阔疆域。海盗代表着叛逆、个性、自由、放荡不羁，信念与执著， 勇敢与拼搏，对未知领域的探索欲望。</p><p style="margin-top: 5px;">“维京联盟愿景：遍布全重庆、全中国，我们身上充满维京人“霸据一方”的海盗文化，我们是全重庆最优秀的创业团队，我们是维京联盟！</p><p style="margin-top: 5px;"><strong><span style="font-size: 18px;">服务特色</span></strong></p><p style="margin-top: 5px;">易点学车引入智能化驾培体系，全面重塑服务品质，拒绝传统教练冷嘲热讽、日晒雨淋，杜绝吃拿卡要；智能化驾培体系拥有高速撞车、翻车的模拟体验，旨在全面提高广大学车学员安全文明驾驶能力。</p><p style="margin-top: 5px;">易点学车练车、考试、接送过程中全程保险赔付，保额高达80万元，从报名开始直到拿证全程护航。</p><p style="margin-top: 5px;"><strong><span style="font-size: 18px;">优势承诺</span></strong></p><p style="margin-top: 5px;">1. 智能化学车平台：精准教学，拒绝冷嘲热讽，日晒雨淋</p><p style="margin-top: 5px;">2. VR练车：提高安全文明驾驶，重塑驾培体验；足不出校，轻松学车</p><p style="margin-top: 5px;">3. 优秀教练：优秀直营教练，通过率提高20%</p><p style="margin-top: 5px;">4. 就近学车：众多场地供你选择，距离学校不超过2KM</p><p style="margin-top: 5px;">5. 费用透明：拒绝价格陷阱，绝无隐形消费</p><p style="margin-top: 5px;">6. 学车保障：80万高额保险，学车无忧</p><p style="margin-top: 5px;">7. 急速拿证：标准两月拿证流程，最快40天</p><p style="margin-top: 5px;">8. 考试保过：五次考爆不过免费重学</p><p><br/></p>', 1525680089),
(8, '成为“最美代言人”获得10000元现金大奖', 2, '../upload/./201708/27/0_150411765qtDj.jpg', '../upload/./201708/29/0_150429550XgvA.jpg', '', '', '<p style="text-align: center; margin-top: 5px;">敢拼敢博，青春不白活</p><p style="text-align: center; margin-top: 5px;">敢拍敢秀，10000元现金拿走</p><p style="margin-top: 5px; text-align: center;"><span style="text-align: center;">女人需要的不仅是婚纱照，而是一个做女神的充分理由</span></p><p style="margin-top: 5px; text-align: center;"><span style="text-align: center;">男人需要的不仅是笔挺的西装，而是一个让女人欣赏你的舞台</span></p><p style="margin-top: 5px; text-align: center;"><span style="text-align: center;">女汉子都洗洗睡吧，真正的女神在这里</span></p><p style="margin-top: 5px; text-align: center;"><span style="text-align: center;">如果你貌美如花，颜值爆表</span></p><p style="margin-top: 5px; text-align: center;"><span style="text-align: center;">如果你优雅从容，气质担当</span></p><p style="margin-top: 5px; text-align: center;"><span style="text-align: center;">如果你活力无限，光芒万丈</span></p><p style="margin-top: 5px; text-align: center;"><span style="text-align: center;">不妨来晒几张照片</span></p><p style="margin-top: 5px; text-align: center;"><span style="text-align: center;">展现独一无二的您</span></p><p style="margin-top: 5px; text-align: center;"><span style="text-align: center;">出任董事长！秘书，博创业资金，赢万元奖金，走上人生巅峰，想想是不是有点小激动呢</span></p><p style="margin-top: 5px;"><span style="color: rgb(255, 0, 0);"><br/></span></p><p style="margin-top: 5px;"><a href="http://ydxc.yooyor.com/client/zt2.html" target="_blank"><span style="color: rgb(255, 0, 0);"><strong>点此进入</strong></span></a></p>', 1504007500),
(9, '合伙人申请', 3, '', '', '', '<iframe frameborder="0" width="100%" height="300" src="https://v.qq.com/iframe/player.html?vid=e0543moqtl4&tiny=0&auto=0" allowfullscreen></iframe>', '<p style="text-indent: 0em; margin-top: 10px; margin-bottom: 10px;"><strong><span style="font-size: 18px; text-indent: 0em;">我们在寻找：</span></strong><br/></p><p style="text-indent: 0em;">我们需要强者和对未来有目标并且能够自我燃烧的您，男女不限，这里可以让您得到高额报酬、给您成长空间、获得创业资金、成为股东一切都不是梦想，我们一直在寻找牛B的您！</p><p style="text-indent: 0em; margin-top: 10px; margin-bottom: 10px;"><strong><span style="font-size: 18px;">维京联盟愿景：</span></strong></p><p style="text-indent: 0em;">“维京人”，指北欧海盗，他们从公元8世纪到11世纪一直侵扰欧洲沿海和英国岛屿，其足迹遍布从欧洲大陆至北极广阔疆域。海盗代表着叛逆、个性、自由、放荡不羁，信念与执著， 勇敢与拼搏，对未知领域的探索欲望。</p><p style="text-indent: 0em;">“维京联盟愿景：遍布全重庆、全中国，我们身上充满维京人“霸据一方”的海盗文化，我们是全重庆最优秀的创业团队，我们是维京联盟！</p><p><br/></p>', 1504004206),
(10, '平台操作指南', 4, '', '../upload/./201708/29/0_150431513H7z0.jpg', '', '', '<p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><a href="http://yidianxueche.cn/index.php?do=xlc_map&tj=1" target="_blank"><span style="text-decoration: underline; color: rgb(84, 141, 212);"><strong><span style="color: rgb(84, 141, 212); font-size: 18px;">报名</span></strong></span></a><strong><span style="font-size: 18px;">流程</span></strong><strong><span style="font-size: 18px;"></span></strong><strong><span style="font-size: 18px;">：</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">点击首页下方报名按钮—&gt;选择一个合适的科目二场地—&gt;选择场地内的虚拟教练员—&gt;点击下方我要报名—&gt;选择一个心仪的班别—&gt;确定班别详细信息后点击下方确认报名—&gt;完善所有个人信息之后点击下方支付完成报名</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><a href="http://yidianxueche.cn/index.php?do=xlc_map&tj=1" target="_blank" style="text-decoration: underline;"><span style="text-decoration: underline; color: rgb(84, 141, 212);"><strong><span style="color: rgb(84, 141, 212); font-size: 18px;">申请体检码</span></strong><strong><span style="color: rgb(84, 141, 212); font-size: 18px;"></span></strong></span><strong><span style="font-size: 18px;"></span></strong></a><strong><span style="font-size: 18px;">流程：</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">点击首页菜单按钮中报名体检按钮—&gt;在地图页面上点选体检按钮—&gt;选择一个合适的体检站—&gt;在下方弹出的窗口中选择一个合适的体检站—&gt;点击下方确认申请支付之后完成申请</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">入籍流程：</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;">体检完毕之后准备好身份证原件、体检表、自身拍照条件添加申请体检码提示的QQ号告知需要进行入籍—&gt;按照对方发送的标准拍好各项资料发送给对方—&gt;等待接收入籍成功短信</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><strong><span style="font-size: 18px;">首页菜单内容解析：</span></strong></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><a href="http://ydxc.yooyor.com/ydxc/index.php?do=new_detail&id=4" target="_blank" style="text-decoration: underline; color: rgb(84, 141, 212);"><span style="color: rgb(84, 141, 212);">VR学车</span></a>：查看VR学车详细内容与优势</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><a href="http://ydxc.yooyor.com/ydxc/index.php?do=new_detail&id=3" target="_blank" style="text-decoration: underline; color: rgb(84, 141, 212);"><span style="color: rgb(84, 141, 212);">优势服务</span></a>：查看本平台优势服务内容</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><a href="http://ydxc.yooyor.com/ydxc/index.php?do=xlc_map" target="_blank" style="text-decoration: underline; color: rgb(84, 141, 212);"><span style="color: rgb(84, 141, 212);">全部场地</span></a>：查看本平台所有科目二科目三体检站场地，点击可选择进行报名</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><a href="http://ydxc.yooyor.com/ydxc/index.php?do=partner&id=9" target="_blank" style="text-decoration: underline; color: rgb(84, 141, 212);"><span style="color: rgb(84, 141, 212);">合伙人申请</span></a>：查看易点学车高校市场战队——维京联盟文化，并申请加入</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><a href="http://ydxc.yooyor.com/ydxc/index.php?do=new_detail&id=5" target="_blank"><span style="color: rgb(84, 141, 212);">学车流程</span></a>：查看从报名到拿证整个学车流程</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><a href="http://ydxc.yooyor.com/ydxc/index.php?do=new_detail&id=6" target="_blank"><span style="color: rgb(84, 141, 212);">学车保障</span></a>：查看易点学车专属学车保障内容</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal;"><a href="http://ydxc.yooyor.com/ydxc/index.php?do=xlc_map&tj=1" target="_blank" style="color: rgb(84, 141, 212); text-decoration: underline;"><span style="color: rgb(84, 141, 212);">报名体检</span></a>：学车报名、选择科目三教练以及申请体检码入口</p><p><br/></p>', 1519354669),
(11, '理论预约流程', 4, '', '../upload/./201708/27/0_150412518oXW3.jpg', '', '', '<p style="text-align: center; margin-top: 5px;"><span style="font-size: 24px;">科目一学习方法以及预约流程</span></p><p style="text-align: center; margin-top: 5px;">西培学堂网址：<span style="text-decoration: underline; color: rgb(255, 0, 0);"><a href="http://www.cqxpxt.com/" style="text-decoration: underline; color: rgb(255, 0, 0);">http://www.cqxpxt.com/</a></span></p><p style="margin-top: 5px; text-align: center;">点击可访问</p><p style="margin-top: 5px;"><br/></p><p style="margin-top: 5px;">一、学习方法</p><p style="text-indent: 2em; margin-top: 5px;">科目一理论学习为6+16模式，前边6个小时需要在西培学堂指定培训点进行面授上课，中途不能离开，并且为人脸识别认证；6个小时学习完毕之后后边16个小时可在网络上边进行学习，也可在课堂进行面授学习</p><p style="text-indent: 2em; margin-top: 5px;"><br/></p><p style="text-indent: 0em; margin-top: 5px;">二、预约流程</p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503832882696801.png" title="1503832882696801.png" alt="blob.png"/></p><p style="text-indent: 2em; margin-top: 5px;">请您在首页右上方“用户登录”输入您的身份证号码，初始密码是身份证号码的后6位数字。</p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503834101496624.png" title="1503834101496624.png" alt="1503834101496624.png" width="350" height="113"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503832938997982.png" title="1503832938997982.png" alt="1503832938997982.png" width="380" height="1"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503833678767163.png" title="1503833678767163.png" alt="blob.png"/></p><p style="text-indent: 2em; margin-top: 5px;">如果您是第一次登录，您将直接进入<span style="color: rgb(84, 141, 212);">“面授预约”</span>，首先，请您选择参加面授的地点。选择面授地点后，请选择参加面授的日期、时间、班次、教室。</p><p style="text-indent: 2em; margin-top: 5px;">如果您参加完6个学时面授培训以后，仍然选择课堂学习，请您点击<span style="color: rgb(84, 141, 212);">“面授预约”</span>，选择参加面授的地点，然后选择参加面授的<span style="color: rgb(84, 141, 212);">日期、时间、班次、教室。</span></p><p style="text-indent: 2em; margin-top: 5px;">预约面授成功后，系统会发送短信至您的手机。</p><p style="text-indent: 2em; margin-top: 5px;">您可以点击“课程表下载”，下载查看相关课程安排。<br/><span style="color: rgb(255, 0, 0);">特别提示：</span></p><p style="text-indent: 2em; margin-top: 5px;"><span style="text-indent: 2em;">1、“网上学习面授班”为参加网络学习前的6个学时的面授培训内容。选择在网络教学平台学习的学员或第一次参加培训的学员请预约“网上学习面授班”班次。</span><br/></p><p style="text-indent: 2em; margin-top: 5px;">2、如果您已参加完成“网上学习面授班”培训后，仍选择线下课堂学习，请预约“课堂学习面授班”班次。</p><p style="text-indent: 2em; margin-top: 5px;">3、面授学习均需提前一天预约。</p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503834781810896.png" title="1503834781810896.png" alt="1503834781810896.png" width="350" height="214"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503834847892086.png" title="1503834847892086.png" alt="1503834847892086.png" width="350" height="192"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835032173018.png" title="1503835032173018.png" alt="1503835032173018.png" width="350" height="161"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835040362644.png" title="1503835040362644.png" alt="1503835040362644.png" width="350" height="150"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835048839473.png" title="1503835048839473.png" alt="1503835048839473.png" width="350" height="89"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835056316138.png" title="1503835056316138.png" alt="1503835056316138.png" width="350" height="1"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835063956735.png" title="1503835063956735.png" alt="blob.png"/></p><p style="margin-top: 5px;"><br/></p><p style="text-indent: 2em; margin-top: 5px;">当您参加满6个学时的面授培训以后，您的手机将收到短信提示，您再次登录后，点击右上方“理论学习” 然后再点击右侧的“点击学习”就能进入教学视频播放界面。</p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835249551632.png" title="1503835249551632.png" alt="1503835249551632.png" width="350" height="134"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835268952765.png" title="1503835268952765.png" alt="1503835268952765.png" width="350" height="84"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835286648926.png" title="1503835286648926.png" alt="1503835286648926.png" width="350" height="1"/></p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835314157577.png" title="1503835314157577.png" alt="blob.png"/></p><p style="text-indent: 2em; margin-top: 5px;"><span style="color: rgb(255, 0, 0);">因学习计时需进行人像验证，在您学习前，请您查看是否正确安装摄像头。</span></p><p style="margin-top: 5px;"><span style="color: rgb(84, 141, 212);">1、摄像头购买指导：</span></p><p style="text-indent: 0em; margin-top: 5px;">如果台式电脑未安装摄像头，可以在实体店买或者网上买。<br/> 摄像头规格参数：<br/> Usb：2.0接口以上<br/> 视像分辨率：640*480<br/> 驱动：免驱</p><p style="margin-top: 5px;"><span style="color: rgb(84, 141, 212);">2、摄像头安装指导：</span><br/> (1)、请将摄像头的USB插口插到您的电脑主机USB接口（如果您长期使用，建议插在主机后面板上面。）</p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170827/1503835488784051.png" title="1503835488784051.png" alt="1503835488784051.png" width="350" height="218"/></p><p><br/></p><p style="margin-top: 5px;">(2)、初次使用时，安装如下图。<br/> 摄像头插到usb接口弹出的提示：</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835617878608.png" title="1503835617878608.png" alt="1503835617878608.png" width="350" height="82"/></p><p style="margin-top: 5px;">(3)、安装成功：</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835623404295.png" title="1503835623404295.png" alt="1503835623404295.png" width="350" height="109"/></p><p style="margin-top: 5px;">(4)、安装成功后，点击右下角的小图标，会显示——可以使用字样。</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835629293128.png" title="1503835629293128.png" alt="1503835629293128.png" width="350" height="211"/></p><p style="margin-top: 5px;">(5)、最后，调试一下视频设备，看看如何吧！<br/> （注：在Win7中，视频画面需要第三方软件才可以显示，所以我们可以在QQ中来查看设备工作状态，在QQ面板中打开视频调试。）</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835641828020.png" title="1503835641828020.png" alt="1503835641828020.png" width="350" height="414"/></p><p style="margin-top: 5px;">(6)、切换到视频设置中，等待几秒后你应该会看到视频画面。显示视频设备启动成功，并且可以看到画面。这时，您刷新“理论学习”界面就可以进行视频验证了。</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835648561869.png" title="1503835648561869.png" alt="1503835648561869.png" width="350" height="284"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835679203366.png" title="1503835679203366.png" alt="1503835679203366.png" width="350" height="1"/></p><p style="margin-top: 5px;"><img width="804" height="1" src="http://yidianxueche.cn/admin/ueditor/themes/default/images/spacer.gif" alt="http://static.cqxp.cqxpxt.com/img/xxzl/img2.png"/><br/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835668756189.png" title="1503835668756189.png" alt="blob.png"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835686985369.png" title="1503835686985369.png" alt="1503835686985369.png" width="350" height="119"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835691702513.png" title="1503835691702513.png" alt="1503835691702513.png" width="350" height="106"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835695456367.png" title="1503835695456367.png" alt="1503835695456367.png" width="350" height="165"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835701545103.png" title="1503835701545103.png" alt="1503835701545103.png" width="350" height="23"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835708519390.png" title="1503835708519390.png" alt="1503835708519390.png" width="350" height="1"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835712163555.png" title="1503835712163555.png" alt="blob.png"/></p><p style="margin-top: 5px;">考题练习：在参加科目一考试前，您可以在西培学堂进行考题练习。</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835718233496.png" title="1503835718233496.png" alt="1503835718233496.png" width="350" height="116"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835723321769.png" title="1503835723321769.png" alt="1503835723321769.png" width="350" height="135"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835733536003.png" title="1503835733536003.png" alt="1503835733536003.png" width="350" height="1"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835738281549.png" title="1503835738281549.png" alt="blob.png"/></p><p style="margin-top: 5px; text-align: center;"><span style="color: rgb(84, 141, 212);">(一）查看学时</span></p><p style="margin-top: 5px;">您可以在<span style="color: rgb(255, 0, 0);">“理论学习”</span>界面看见自己的学时完成情况<br/> 也可以进入<span style="color: rgb(255, 0, 0);">“个人中心”</span>查看自己的学习情况。</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835746603331.png" title="1503835746603331.png" alt="1503835746603331.png" width="350" height="257"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835750379091.png" title="1503835750379091.png" alt="1503835750379091.png" width="350" height="232"/></p><p style="margin-top: 5px; text-align: center;"><span style="color: rgb(84, 141, 212);">(二）修改，忘记密码</span></p><p style="margin-top: 5px;">如果需要修改密码，请进入<span style="color: rgb(255, 0, 0);">“个人中心”</span>选择“修改密码”。<br/> 如果忘记密码，1、您可以在首页“用户登录”下方点击<span style="color: rgb(255, 0, 0);">“忘记密码”</span>，核对相关信息后，<br/> 我们会将您的密码以短信方式发送到您的手机；2、您可以拨打<span style="color: rgb(255, 0, 0);">4001025505</span>客服电话，<br/> 客服人员核对相关信息后，将您的密码重置为<span style="color: rgb(255, 0, 0);">初始密码</span>。</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835759999893.png" title="1503835759999893.png" alt="1503835759999893.png" width="350" height="214"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835766985940.png" title="1503835766985940.png" alt="1503835766985940.png" width="350" height="149"/></p><p style="margin-top: 5px; text-align: center;"><span style="color: rgb(84, 141, 212);">(三）学习疑问或投诉意见</span></p><p style="margin-top: 5px;">(1)、您可以点击右侧的<span style="color: rgb(255, 0, 0);">“在线提问”</span>通过<span style="color: rgb(255, 0, 0);">“我要提问”</span>将相关问题反馈给我们， 我们将及时给您回复，您可在<span style="color: rgb(255, 0, 0);">“我的提问”</span>中看见回复情况。<br/> (2)、您可以点击右侧的<span style="color: rgb(255, 0, 0);">“联系我们”</span>，教学内容问题可通过“在线教师”与线上教师沟通； 其它问题可通过<span style="color: rgb(255, 0, 0);">“在线客服”</span>或者拨打<span style="color: rgb(255, 0, 0);">400-102-5505</span>客服电话与我们联系，您反馈的问题， 我们将及时给您回复。</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835772479999.png" title="1503835772479999.png" alt="1503835772479999.png" width="350" height="213"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835777271104.png" title="1503835777271104.png" alt="1503835777271104.png" width="350" height="229"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170827/1503835782885455.png" title="1503835782885455.png" alt="1503835782885455.png" width="350" height="179"/></p><p><br/></p>', 1503837182),
(12, '约考缴费流程', 4, '', '../upload/./201708/28/0_150418315q2WK.jpg', '', '', '<p style="margin-top: 5px; text-align: center;"><span style="font-size: 24px;">约考缴费流程</span></p><p style="margin-top: 5px;">&nbsp;</p><p style="margin-top: 5px;"><span style="font-size: 18px;">1. 约考流程</span></p><p style="margin-top: 5px;"><span style="color: rgb(255, 0, 0);">输入约考统一网址:&nbsp;</span><a href="http://cq.122.gov.cn" target="_blank"><span style="text-decoration: underline; color: rgb(255, 0, 0);">http://cq.122.gov.cn/</span></a><span style="color: rgb(255, 0, 0); text-decoration: none;">&nbsp; </span><span style="color: rgb(0, 0, 0); text-decoration: none;">(点击可访问)</span></p><p style="margin-top: 5px;">点击个人登录, 登录名为身份证号码,密码为收到的重庆交巡警平台发出六位数字的初始密码(短信接收)</p><p style="text-align: center; margin-top: 5px;"><img src="/ueditor/php/upload/image/20170828/1503893237325713.png" title="1503893237325713.png" alt="1503893237325713.png" width="350" height="192"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893243289005.png" title="1503893243289005.png" alt="1503893243289005.png" width="350" height="187"/></p><p><br/></p><p style="margin-top: 5px;">如若密码遗失,选择找回密码,填写身份证和姓名并填写验证码重置密码即可</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893261863998.png" title="1503893261863998.png" alt="1503893261863998.png" width="350" height="184"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893265290504.png" title="1503893265290504.png" alt="1503893265290504.png" width="350" height="186"/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893269689372.png" title="1503893269689372.png" alt="1503893269689372.png" width="350" height="172"/></p><p><br/></p><p style="margin-top: 5px;">1)&nbsp;&nbsp;&nbsp; 点击驾驶证业务</p><p style="margin-top: 5px;">2)&nbsp;&nbsp;&nbsp; 点击在线办理</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893282115754.png" title="1503893282115754.png" alt="1503893282115754.png" width="350" height="382"/></p><p><br/></p><p style="margin-top: 5px;">3)&nbsp;&nbsp;&nbsp; 选择考试科目，点击下一步</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893287615801.png" title="1503893287615801.png" alt="1503893287615801.png" width="350" height="193"/></p><p>&nbsp;</p><p style="margin-top: 5px;">4)&nbsp;&nbsp;&nbsp; 点击阅读并同意</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893293540965.png" title="1503893293540965.png" alt="1503893293540965.png" width="350" height="338"/></p><p><br/></p><p style="margin-top: 5px;">5)&nbsp;&nbsp;&nbsp; 选择考试时间段并选择考场，具体考场和教练员沟通,点击查询</p><p style="margin-top: 5px;"><br/></p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893315117034.png" title="1503893315117034.png" alt="1503893315117034.png" width="350" height="119"/></p><p style="margin-top: 5px;"><br/></p><p style="margin-top: 5px;">6)&nbsp; 选择考试日和当天考试的场次,具体和驾校和教练员沟通, 这里会提示当天考试总人数和预约人数，可选择场次或更换场次</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893344321345.png" title="1503893344321345.png" alt="1503893344321345.png" width="350" height="336"/></p><p style="margin-top: 5px;"><br/></p><p style="margin-top: 5px;">7)&nbsp;&nbsp;&nbsp; 这里先验证当时登录报名填写的手机号码，然后点击提交预约申请信息，约考完毕</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893353327725.png" title="1503893353327725.png" alt="1503893353327725.png" width="350" height="242"/></p><p><br/></p><p><br/></p><p style="margin-top: 5px;"><strong><span style="font-size: 20px; color: rgb(255, 0, 0);">2. 缴考试费流程</span></strong></p><p style="margin-top: 5px;"><strong><span style="font-size: 20px; color: rgb(255, 0, 0);"><br/></span></strong></p><p style="margin-top: 5px;">输入考试缴费统一网站：<span style="text-decoration: underline; color: rgb(255, 0, 0);">http://</span><a href="http://www.ggjfw.com/" style="text-decoration: underline; color: rgb(255, 0, 0);"><span style="color: rgb(255, 0, 0);">www.ggjfw.com</span></a>&nbsp;(点击可访问)（网上缴费不能使用支付宝和微信支付只能使用网银和绑定手机号码的银行卡）</p><p style="margin-top: 5px;">1)&nbsp;&nbsp;&nbsp; 选择重庆</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893364372087.png" title="1503893364372087.png" alt="1503893364372087.png" width="350" height="305"/></p><p><br/></p><p style="margin-top: 5px;">2)&nbsp;&nbsp;&nbsp; 选择车管所网上缴费平台</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893374122230.png" title="1503893374122230.png" alt="1503893374122230.png" width="350" height="196"/></p><p><br/></p><p style="margin-top: 5px;">3)&nbsp;&nbsp;&nbsp; 选择驾管业务网上缴费</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893379927407.png" title="1503893379927407.png" alt="1503893379927407.png" width="350" height="275"/></p><p><br/></p><p style="margin-top: 5px;">4)&nbsp;&nbsp;&nbsp; 完善个人信息之后点击申请查询（注意不要点击申请缴费）</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893384365248.png" title="1503893384365248.png" alt="1503893384365248.png" width="350" height="289"/></p><p><br/></p><p style="margin-top: 5px;">5)&nbsp;&nbsp;&nbsp; 如没有缴费记录则点击申请缴费</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893389241078.png" title="1503893389241078.png" alt="1503893389241078.png" width="350" height="122"/></p><p><br/></p><p style="margin-top: 5px;">6)&nbsp;&nbsp;&nbsp; 点击同意</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893396515147.png" title="1503893396515147.png" alt="1503893396515147.png" width="350" height="256"/></p><p><br/></p><p style="margin-top: 5px;">7)&nbsp;&nbsp;&nbsp; 先选择科目考试，然后选择考试科目，比如科目一科目二，然后提交订单</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893404963275.png" title="1503893404963275.png" alt="1503893404963275.png" width="350" height="258"/></p><p><br/></p><p style="margin-top: 5px;">8)&nbsp;&nbsp;&nbsp; 核对信息无误之后点击确认并缴费</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893412539437.png" title="1503893412539437.png" alt="1503893412539437.png" width="350" height="257"/></p><p><br/></p><p style="margin-top: 5px;">9)&nbsp;&nbsp;&nbsp; 输入网银所绑定的手机号码并填写手机验证码</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893419839356.png" title="1503893419839356.png" alt="1503893419839356.png" width="350" height="227"/></p><p><br/></p><p style="margin-top: 5px;">10)&nbsp;&nbsp;&nbsp;&nbsp; 核对无误之后点击下一步</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893426695615.png" title="1503893426695615.png" alt="1503893426695615.png" width="350" height="172"/></p><p><br/></p><p style="margin-top: 5px;">11)&nbsp;&nbsp;&nbsp;&nbsp; 点击去付款</p><p style="margin-top: 5px;">&nbsp;</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893431279173.png" title="1503893431279173.png" alt="1503893431279173.png" width="350" height="232"/></p><p><br/></p><p style="margin-top: 5px;">12)&nbsp;&nbsp;&nbsp;&nbsp; 输入银行卡号之后点击下一步</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893436913596.png" title="1503893436913596.png" alt="1503893436913596.png" width="350" height="226"/></p><p><br/></p><p>13)&nbsp;&nbsp;&nbsp;&nbsp; 完善信息之后点击付款</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893440580978.png" title="1503893440580978.png" alt="1503893440580978.png" width="350" height="223"/></p><p><br/></p><p style="margin-top: 5px;">14)&nbsp;&nbsp;&nbsp;&nbsp; 缴费完毕，点击返回商户可检查缴费信息</p><p style="text-align:center"><img src="/ueditor/php/upload/image/20170828/1503893447805722.png" title="1503893447805722.png" alt="1503893447805722.png" width="350" height="237"/></p><p><br/></p><p style="margin-top: 5px;">15)&nbsp;&nbsp;&nbsp;&nbsp; 付款成功回执信息</p><p style="text-align: center;"><img src="/ueditor/php/upload/image/20170828/1503893457415224.png" title="1503893457415224.png" alt="1503893457415224.png" width="350" height="166"/></p>', 1503895158);
