(25, '服务承诺', '0', NULL, '', 0, NULL, '', NULL, NULL, NULL, '', 0, 0, 0, 0, NULL, '', '', '<p class="title_p" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 30px; font-size: 13px; line-height: 23.3999996185303px; font-family: 宋体, Arial; white-space: normal; background-color: rgb(255, 255, 255);">尊敬的客户，为了向您提供优质高效的信息服务，不断提升我们的服务品质，我们郑重做出以下承诺，请您对我们的服务与工作予以监督。</p><h2 style="margin: 15px 0px 10px; padding: 0px 0px 0px 15px; font-size: 12px; line-height: 36px; color: rgb(76, 76, 76); font-family: 宋体, Arial; white-space: normal; background: url(http://www.wanfangdata.com.cn/Css/Images/stastic-arrow.gif) 0px -188px no-repeat rgb(243, 243, 243);">服务目标</h2><p class="title_p" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 30px; font-size: 13px; line-height: 23.3999996185303px; font-family: 宋体, Arial; white-space: normal; background-color: rgb(255, 255, 255);">让用户满意，让用户放心，全心全意为用户服务，持续改进，不断提升服务品质。</p><h2 style="margin: 15px 0px 10px; padding: 0px 0px 0px 15px; font-size: 12px; line-height: 36px; color: rgb(76, 76, 76); font-family: 宋体, Arial; white-space: normal; background: url(http://www.wanfangdata.com.cn/Css/Images/stastic-arrow.gif) 0px -188px no-repeat rgb(243, 243, 243);">服务热线</h2><p class="title_p" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 30px; font-size: 13px; line-height: 23.3999996185303px; font-family: 宋体, Arial; white-space: normal; background-color: rgb(255, 255, 255);">客服电话：4000-115-888</p><p class="title_p" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 30px; font-size: 13px; line-height: 23.3999996185303px; font-family: 宋体, Arial; white-space: normal; background-color: rgb(255, 255, 255);">人工服务时间：8:00-11:30,13:00-17:00(工作日)</p><p class="title_p" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 30px; font-size: 13px; line-height: 23.3999996185303px; font-family: 宋体, Arial; white-space: normal; background-color: rgb(255, 255, 255);">邮箱：<a href