ext-indent: 30px; font-size: 13px; line-height: 23.3999996185303px; font-family: 宋体, Arial; white-space: normal; background-color: rgb(255, 255, 255);">电话：4000-115-888</p><p class="title_p" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 30px; font-size: 13px; line-height: 23.3999996185303px; font-family: 宋体, Arial; white-space: normal; background-color: rgb(255, 255, 255);">邮箱：<a href="mailto:problem@wanfangdata.com.cn" style="margin: 0px; padding: 0px; color: rgb(0, 51, 153); text-decoration: none;">problem@wanfangdata.com.cn</a></p><p><br/></p>', '', '', 16, 1439863642, 'admin', '1', 0, NULL, NULL, NULL, '', ''),
(26, '理赔流程', '0', NULL, '', 0, NULL, '', NULL, NULL, NULL, '', 0, 0, 0, 0, NULL, '', '', '<p style="text-align:left;padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;"><strong>车险理赔流程</strong></p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">近几年，多家保险公司为了提高服务质量，加快工作效率，相继推出了各种快速赔付的服务。比如，人保的“万元以内1小时赔付”， 平安的“72小时以内快速结案”等。因此，车险理赔的流程越来越简化。请参考下图：</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;"><img src="/ueditor/php/upload/image/20150818/1439863701139646.jpg" style="border: 0px; width: 640px; margin-left: -2em;"/></p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">第一步：出险</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">所谓“出险”包含面很广，包括单方事故、双方事故、多方事故，甚至车停路边上被人划了也可叫出险。总之说白了，只要是让保险公司掏钱给你修车，都可以叫做“出险”。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">第二步：报案</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">发生交通事故了，首先需要拨打122事故报警台，通过交警判定责任方，有责任的一方负责拨打自己投保的保险公司进行报案。如果是单方事故或轻微事故，可以自行拍照后将车开走，并在出险后48小时内向保险公司报案即可。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">第三步：查勘定损</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">保险公司接到报案后，会对车辆进行查勘定损，并根据车辆的受损情况确定损失金额。如果理赔金额超出承保上限，需要车主或有责任的一方自掏腰包补差价。发生轻微事故，车主可直接将车辆开到定损中心进行定损。如果损失较大的，保险公司会派查勘员到事故现场进行查勘。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">第四步：递交理赔材料</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">理赔材料包括车辆的保单、行驶本、驾驶本、被保险人的身份证及责任认定书，单方事故无需提交责任认定书。如果涉及到人伤的，还需提供伤者的诊断证明及医疗费发票。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">第五步：修车</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">车主可以自行选择喜欢的4S店或熟悉的修理厂进行维修，但在保险公司业务大厅办理定损时就提前告知工作人员，选择好修理地点后，不再更改。修理完成后，车主需要垫付维修款，并需开具与定损金额一致的发票及维修清单。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">第六步：领取赔款</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">修完车后被保险人需要携带定损单、维修发票、维修清单及银行卡到定损大厅办理领取赔款手续。一般不超过7个工作日，理赔款会打入被保险人的银行卡账户内。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;"><strong>保险直赔</strong></p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">直赔是指车辆的维修费用由保险公司直接与维修方结付，被保险人无须支付维修费用，只需交齐相关材料后即可将车辆取走。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 15px; font-stretch: normal; line-height: 28px; font-family: 宋体; color: rgb(51, 51, 51); width: 640px; text-indent: 2em; word-wrap: break-word; word-break: normal; white-space: normal;">如果车身有伤想维修或出现轻微事故后，车主可以找一家保险公司认可的，可以保险直赔的修理厂或4S店进行维修。你只需要带着保单、被保人的身份证、驾驶证、行驶证直接到那里，什么都不用管，把车往那一放就可以了，甚至你都不用报案，工作人员会帮你搞定，免去所有流程，修好后直接开车走人，无需垫付钱款，省时省力。</p><p><br/></p>', '', '', 3, 1439863702, 'admin', '1', 0, NULL, NULL, NULL, '', ''),
