(33, '什么是车损险？', '0', NULL, '', 0, NULL, '', NULL, NULL, NULL, '', 0, 0, 0, 0, NULL, '', '', '<p><span style="color: rgb(102, 102, 102); font-family: tahoma, arial, 宋体; font-size: 12px; line-height: 20px; background-color: rgb(255, 255, 255);">汽车车损险指，被保险人或其允许的驾驶员在驾驶保险车辆时发生保险事故，造成保险车辆受损，保险公司在合理范围内予以赔偿。责任范围：⑴被保险人或其允许的驾驶人员在使用保险车辆过程中，因下列原因造成保险车辆的损失，保险人负责赔偿：①碰撞、倾覆、坠落；②火灾、爆炸、自燃（须另投自燃险）；③外界物体坠落、倒塌；④暴风、龙卷风；⑤雷击、雹灾、暴雨、洪水、海啸；⑥地陷、冰陷、崖崩、雪崩、泥石流、滑坡；⑦载运保险车</span></p>', '', '', 0, 1439866898, 'admin', '1', 0, NULL, NULL, NULL, '', ''),
(34, '什么是盗抢险', '0', NULL, '', 0, NULL, '', NULL, NULL, NULL, '', 0, 0, 0, 0, NULL, '', '', '<p>盗抢险全称是机动车辆全车盗抢险，机动车辆全车盗抢险的保险责任为全车被盗窃、被抢劫、被抢夺造成的车辆损失以及在被盗窃、被抢劫、被抢夺期间受到损坏或车上零部件、附属设备丢失需要修复的合理费用。可见，机动车辆全车盗抢险的保险责任包含两部分：一是因被盗窃、被抢劫、被抢夺造成的保险车辆的损失；二是因保险车辆被盗窃、被抢劫、被抢夺造成的合理费用支出。对上述两部分费用由保险公司在保险金额内负责赔偿保险</p>', '', '', 4, 1439866935, 'admin', '1', 0, NULL, NULL, NULL, '', ''),
(35, '新车交强险能否与商业险分开买？', '0', NULL, '', 0, NULL, '', NULL, NULL, NULL, '', 0, 0, 0, 0, NULL, '', '', '<p>对于“交强险”这一词，很多车主都不会陌生。但是车主一般都只是关心车险的总价钱（交强险和商业险总费用），而对于交强险的费用并不清楚。对于“交强险”这一词，很多车主都不会陌生。但是车主一般都只是关心车险的总价钱（交强险和商业险总费用），而对于交强险的费用并不清楚。对于“交强险”这一词，很多车主都不会陌生。但是车主一般都只是关心车险的总价钱（交强险和商业险总费用），而对于交强险的费用并不清楚。对于“交强险”这一词，很多车主都不会陌生。但是车主一般都只是关心车险的总价钱（交强险和商业险总费用），而对于交强险的费用并不清楚。</p>', '', '', 4, 1439866980, 'admin', '1', 0, NULL, NULL, NULL, '', ''),
(36, '交强险理赔流程是怎样的？', '0', NULL, '', 0, NULL, '', NULL, NULL, NULL, '', 0, 0, 0, 0, NULL, '', '', '<p>保险公司已经简化了交强险理赔手续和流程、缩短了结案周期、完善了抢救费用垫付机制。车主在购买交强险时，注意记录保险公司的理赔电话号码。交强险申请理赔如涉及第三者伤亡或财产损失的道路交通事故，被保险人应先联系120急救电话(如有人身伤亡)，拨打110交警电话，并拨打保险公司的电话报案，配合保险公司查勘现场，可以根据情况要求保险公司支付或垫付抢救费。</p><p>&nbsp;</p><p>保险公司会告知被保险人或者受害人具体的赔偿程序等有关事项。保险公司理赔受理后，有责方车辆的保险公司应进行查勘，对受害人的损失进行核定。保险公司收到赔偿申请之日起1天内，书面告知需要提供的与赔偿有关的证明和资料；自收到证明和资料之日起5日内，对是否属于保险责任作出核定，并将结果通知被保险人。对不属于保险责任的，应当书面说明理由。对属于保险责任的，在与被保险人达成赔偿保险金的协议后10日内，赔付保险金。&nbsp;</p><p><br/></p>', '', '', 6, 1439867041, 'admin', '1', 0, NULL, NULL, NULL, '', ''),
(37, '交强险的责任限额是多少？', '0', NULL, '', 0, NULL, '', NULL, NULL, NULL, '', 0, 0, 0, 0, NULL, '', '', '<p>交强险赔偿责任限额几个考虑方面</p><p><br/></p><p>&nbsp; 　保监会有关负责人介绍，确定赔偿责任限额主要是基于以下各方面的考虑： &nbsp;</p><p><br/></p><p>　　一、满足交通事故受害人基本保障需要。 &nbsp;</p><p><br/></p><p>　　二、与国民经济发展水平和消费者支付能力相适应。 &nbsp;</p><p><br/></p><p>　　三、参照了国内其他行业和一些地区赔偿标准的有关规定。 &nbsp;</p><p><br/></p><p>　　机动车交通事故责任强制保险责任限额（2008年2月1日前） &nbsp;</p><p><br/></p><p>　　机动车在道路交通事故中有责任的赔偿限额 &nbsp;</p><p><br/></p>', '', '', 9, 1439867087, 'admin', '1', 0, NULL, NULL, NULL, '', ''),
