(100, '公司简介', '2', NULL, '', 0, NULL, '', NULL, NULL, NULL, '', 0, 0, 0, 0, NULL, '', '', '<p>重庆鼎吉驾驶培训有限公司（简称鼎吉驾校）创建于2014年，是经主管部门批准成立的专门从事机动车驾驶培训企业，鼎吉有近10家子公司并涉足多个产业辐射全国各地，目前，集团已经涵盖汽车产品生产制造。广告传媒。汽车销售、跨境电商、电子科技等行业。鼎吉驾校秉承&quot;学员第一，服务第一&quot;的服务宗旨，用&quot;超出预期的服务质量，优质的管理理念、着力打造一家全面专注于大学生专属的驾校品牌，一切学车流程都以做好大学生及每名学员服务为导向，鼎吉将以一个崭新的创新型驾驶培训企业扎根重庆，辐射西南。</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 公司总部位于重庆市沙坪坝区大学城，紧邻陈家桥轻轨站旁，交通便利，下轻轨即可到达。公司现有标准化训练重庆鼎吉驾驶培训有限公司（简称鼎吉驾校）创建于2014年，是经主管部门批准成立的专门从事机动车驾驶培训企业，鼎吉有近10家子公司并涉足多个产业辐射全国各地，目前，集团已经涵盖汽车产品生产制造。广告传媒。汽车销售、跨境电商、电子科技等行业。鼎吉驾校秉承&quot;学员第一，服务第一&quot;的服务宗旨，用&quot;超出预期的服务质量，优质的管理理念、着力打造一家全面专注于大学生专属的驾校品牌，一切学车流程都以做好大学生及每名学员服务为导向，鼎吉将以一个崭新的创新型驾驶培训企业扎根重庆，辐射西南。</p><p><br/></p>', '', '', 0, 1468488613, 'admin', '1', 0, '', '1468425600', '1468511999', '', ''),
