(145, '培训协议', '28', '', '', 0, '', '0', '0', '0.000000', '0.000000', '', 0, 0, 0, 0, '', '', '', '<p style="text-align: center;"><span style="font-size: 20px;">易点学车服务平台学员协议书</span></p><p>&nbsp;</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">甲方：重庆翼点信息科技有限公司（易点学车）</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">乙方：（学&nbsp;&nbsp;&nbsp; 员）</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">&nbsp;</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">根据《中华人民共和国合同法》等有关法律法规的规定，甲乙双方在自愿、平等的基础上，经协商，就机动车驾驶技能培训事宜达成一致。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第一条、乙方选择 （C1手动挡，C2自动挡）培训方式进行机动车驾驶技能培训；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第二条、乙方向甲方支付培训费用总计 &nbsp;元（学费价格根据乙方选择班别确定）其中包括： 1.学费包含：入学费、工本费、结业证书费、税费、学车全程培训费等； 2.考试费（物价局规定标准）学费均不含各科目考试费，考试时间由学员自行预约和安排，甲方给予乙方指导。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">（1）科目一（交通安全法规和相关知识考试科目）50元/次</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">（2）科目二（场地驾驶技能考试科目）160元/次&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">（3）科目三（道路驾驶技能考试、安全文明驾驶常识科目）180元/次</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">3.该班别服务均不含体检费、所有科目的补考费和考场合场费 。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">4.科目一考试后主管部门核发驾驶技能准考证明，三十日后方可预约科目三考试，机动车驾驶技能准考证明自签发之日起有效期为三年，时间到后，乙方所有成绩作废培训终止。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第三条、甲方应履行的义务&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.按《机动车驾驶培训教学与考试大纲》规定的相应车型培训项目和学时为乙方提供培训服务；&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">2.按公安部《机动车驾驶证申领和使用规定》的要求为乙方办理考试等相关手续，前提是乙方按照甲方要求提交完所有报名所需资料后；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">3.为乙方的培训提供符合标准化的驾驶操作训练场地和教练员；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">4.为乙方的培训提供教练车号牌和标示卡齐备、安全防护装置符合相关标准的教练车；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">5.在乙方通过科一考试后 10 日内安排乙方进行车辆驾驶操作培训；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">6.在《机动车驾驶技能准考证明》有效期内，乙方各科目考试全部合格后，及时协助办理机动车驾驶证；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">7.相关培训、考试事宜应及时履行告知义务；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">8.甲方及所属培训机构及人员不得以任何名目、方式向乙方收取合同规定以外的任何费用或物品。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第四条、乙方的权利和义务</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">1.乙方有权要求甲方按《机动车驾驶培训教学与考试大纲》规定的培训项目、时间完成全部培训项目；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">2.在培训过程中，乙方若受到不公正对待，有权要求甲方予以纠正，并向甲方公示的相关人员和部门投诉处理；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">3.乙方承诺自觉遵守交通法规和甲方的相关规章制度；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">4.乙方承诺自觉维护自身的合法权利；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">5.乙方提供的证件、体检报告及相关信息必须真实有效；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">6.乙方在练车期间，应牢固树立安全意识和遵守交通安全法规，在训练场中不能穿高跟鞋，拖鞋，戴墨镜等影响安全操作的服饰和饰物，不能在患病期间、怀孕期间参加训练，如不听教练员劝阻和要求的，私自操作相关设备，因此产生的一切安全事故责任何损失全部由乙方承担。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第五条、乙方首次考试和补考均不合格，需再次参加补考，后续的相关考试费用由乙方承担。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第六条、双方约定：共同遵守甲方拟定的符合《机动车驾驶培训教学与考试大纲》的教学计划和要求；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">1.乙方应按约定的时间到甲方安排的训练地（场地、道路）参加培训。乙方因故不能参加培训须事前报告甲方，并与甲方协商后续培训时间；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">2.甲方因故调整、变更教学计划应及时通知乙方；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">3.训练过程中，乙方必须遵守培训规程，服从教练员的指挥，在无教练员指导的情况下不得擅自操作教练车；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">4.乙方违反培训规程和安全要求，甲方可对其采取批评教育直至中止培训等措施；如造成事故，全部责任由乙方承担；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">5.乙方如约车后，如有事耽误应提前1个工作日内电话告知甲方教练员取消，如未取消，甲方有权给予乙方延后约车的处罚。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第七条、退学及终止培训</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">1.乙方缴纳学费后，如中途因为个人原因，需按照甲方退学制度规定办理退学手续；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">2.如因为乙方单方面违约退学，甲方按照国家规定对乙方所缴纳总学费20%标准扣除违约金；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">3.乙方退费范畴不包含交于国家的费用及已产生的实际培训费用（包含入学费、工本费、制卡费、体检费、结业证书费、资料管理费、税费、学时费等)仅技能培训费用纳入退费范围，培训费已经产生费用正常扣除后，并办理完退学手续后在7个工作日内一次性退还乙方。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">4.乙方非因甲方原因在《机动车驾驶技能准考证明》有效期（三年）内未能完成全部培训内容的，培训终止。乙方无权要求甲方退还培训费用；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">5.在驾驶技能准考证有效期内，乙方科目二或科目三考试预约次数不能超过五次，第五次考试仍不合格的，已考试合格的其他科目成绩作废，乙方无权要求甲方退费。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第八条、保险赔付及甲方承诺</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">1.乙方在培训期间，由甲方为乙方购买意外伤害保险一份，意外伤害赔付标准按照投保标准执行；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">2.乙方学车过程中，，若出现科目二场地或科目三道路驾驶连续五次未合格的，甲方将为乙方提供免费再学服务；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">3.乙方在学车过程中，如因为甲方教学过程中出现违规操作或变相吃拿卡要行为的，经甲方调查属实，甲方全额赔付乙方学费并让乙方免费学车。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第九条、违约责任</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">1.甲方未按约定对乙方进行培训，造成培训周期延长的，由甲方负责乙方的后续培训工作，由此产生的培训费用由甲方承担；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">2.因乙方原因或不可抗拒原因的（未按时参加培训、预约失败、考场故障，系统原因，考试不合格等）造成培训周期延长的由乙方自行承担责任；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">3.因乙方提供虚假证明和不实证件造成乙方不能参加考试、不能办理机动车驾驶证的，由乙方自行承担责任；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">4.因非甲乙双方因素培训周期延长的，由双方协商解决。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第十条、争议的解决</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">1.本合同在履行过程中发生争议，由双方协商解决；</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">2.若协商未达成一致，可通过市机动车驾驶员培训行业协会或消费者权益保护委员会调解。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">第十一条、其他约定</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">1.本合同未尽事宜由双方协商解决。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">2.本协议一式两份，甲乙双方各执一份。</p><p><br/></p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">请您在支付前认真阅读本约定，您通过点击确认、勾选以及其它任何方式选择接受本约定，即代表您同意接受本约定所含的全部合同条款内容。如您对本协议有任何疑问，请联系相关工作人员询问。</p><p style="margin-top: 5px; margin-bottom: 5px; line-height: normal; text-align: left;">易点学车服务平台祝您学车愉快。</p><p><br/></p>', '', '', 0, 150444269, 'admin', '1', 0, '', '1504108800', '1504195199', '', ''),
